  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Sabine NWR outlines
  Refuge accomplishments from January, 1941 through November, 1942. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, and furbearers-
  is also covered. The Refuge development and maintenance section discusses physical
  developments and plantings. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, and violations. Photographs are attached.\",\n\t\"owner_org\":
